import React from 'react';
import styled from 'styled-components';

const DivCard = styled.div`
width: 22%;
background-color: #dcd5d5;
display: flex;
flex-direction: column;
border-radius: 10px;
`;

const SizeH = styled.h2`
font-size: 2vw;
`;

const SizeHname = styled.h2`
font-size: 2vw;
position: absolute;
`;

const Imagen = styled.img`
object-fit: contain;
width: 100%;
border-radius: 10px 10px 0 0;
`;

const Button = styled.button`
position: absolute;
border: none;
border-radius: 10px 0 0 0;
`;

export default function Card(props) {
   return (
      <DivCard key={props.id}>
         <Imagen src={props.image} alt='imagen' />
         <Button onClick={props.onClose}>X</Button>
         <SizeHgend>{props.gender}</SizeHgend>
         <SizeHname>{props.name}</SizeHname>
         {/* <SizeH>{props.status}</SizeH> */}
         {/* <SizeH>{props.species}</SizeH> */}
         {/* <SizeH>{props.origin.name}</SizeH> */}
      </DivCard>
   );
}
